  dvorah,
  erronBlack,
  cassie,
  centrion,
  frost,
  geras,
  jacqui,
  jade,
  jax,
  johnny,
  kabal,
  kano,
  kitana,
  kollector,
  kotalKahn,
  kungLao,
  liuKang,
  noob,
  raiden,
  scorpion,
  shaoKahn,
  skarlet,
  sonya,
  subzero,
} from "../../index.js";

import * as fs from "fs";

export default class CharCard extends Component {
  render() {
    var data = {},
      dir = __dirname + "/FILES/";
      console.log(dir);

    fs.readdirSync(dir).forEach(function (file) {
      data[file.replace(/.json$/, "")] = require(dir + file);
    });

    return (
      <button className="col-md-3 col-sm-6 mb-5">
        <div className="card">
          <div className="card-header">
            <h1>Shang√£o</h1>
          </div>
        </div>
      </button>
    );
  }
}
